// ComponentB.js
import React from 'react';
import withTimeTracking from '../hok/withTimeTracking';
import './Component.css'; // Подключаем файл со стилями

const ComponentB = ({ timeSpent }) => {
  return <div className="component componentB">Time spent on Page: {timeSpent} seconds</div>;
};

export default withTimeTracking(ComponentB);
